import * as React from 'react';
import { useNavigate } from 'react-router-dom';

export default function Home() {

    const navigate = useNavigate();

    function handleClick() {
        navigate('/auth/')
    }

    return (
        <>
            <h1>Home page</h1>
            <button onClick={handleClick}>Авторизация</button>
        </>
    );
}
